  'ModulesStatsregistrationsAdmin' => 
  array (
    'A significant increase or decrease in customer registration shows that there has probably been a change to your shop. With that in mind, we suggest that you identify the cause, correct the issue and get back in the business of making money!' => 'Sebuah peningkatan atau penurunan jumlah pendaftar yang signifikan menunjukkan bahwa terdapat perubahan pada toko Anda. Oleh karenanya, Anda harus mengidentifikasi sebabnya, melakukan koreksi  dan kembali berbisnis!',
    'Adds a registration progress tab to the Stats dashboard.' => 'Menambahkan tab progress pendaftaran ke statistik dashboard.',
    'An advertising campaign can attract an increased number of visitors to your online store. This will likely be followed by an increase in customer accounts and profit margins, which will depend on customer "quality." Well-targeted advertising is typically more effective than large-scale advertising... and it\'s cheaper too!' => 'Kampanye iklan dapat menarik banyak pengunjung ke toko Anda.  Dan akan meningkatkan pula jumlah pendaftaran dan pendapatan tetapi tergantung \'kualitas\' pelanggan Anda. Iklan yang ditujukan untuk segmen tertentu akan lebih efektif daripada iklan yang dibuat dalam skala besar ... dan juga lebih murah!',
    'CSV Export' => 'Ekspor CSV',
    'Customer accounts' => 'Akun pelanggan',
    'Design and user-friendliness are more important than ever in the world of online sales. An ill-chosen or hard-to-follow graphical theme can keep shoppers at bay. This means that you should aspire to find the right balance between beauty and functionality for your online store.' => 'Desain dan user-keramahan lebih penting daripada sebelumnya: suatu pengunjung sakit-dipilih atau sulit-untuk-mengikuti tema grafis bisa mematikan. Anda harus menyerang keseimbangan yang tepat antara desain inovatif dan membiarkan pengunjung bergerak di sekitar dengan mudah. Ejaan yang tepat dan kejelasan juga menginspirasi kepercayaan klien di toko Anda.',
    'Here is a summary of what may affect the creation of customer accounts:' => 'Berikut adalah ringkasan dari apa yang dapat mempengaruhi pembuatan account pelanggan:',
    'How to act on the registrations\' evolution?' => 'Bagaimana menganggapi evolusi pendaftaran?',
    'If you let your shop run without changing anything, the number of customer registrations should stay stable or show a slight decline.' => 'Jika Anda membiarkan toko Anda berjalan tanpa mengubah apapun, jumlah pelanggan yang mendaftar akan stagnan dan cenderung menurun.',
    'Number of customer accounts created' => 'Jumlah akun pelanggan',
    'Number of visitors who placed an order directly after registration:' => 'Pengunjung yang langsung melakukan pembelian setelah mendaftar:',
    'Number of visitors who stopped at the registering step:' => 'Pengunjung yang berhenti saat proses pendaftaran:',
