    'Once this option is enabled (which is only possible if customers and available quantities are shared among shops), the customer\'s cart will be shared by all shops in this group. This way, any purchase started in one shop will be able to be completed in another shop from the same group.' => 'Setelah opsi ini aktif (jika data pelanggan dan stok dibagi diantara toko lainnya), cart pelanggan akan dibagi ke semua toko di grup ini. Dengan demikian, pembelian yang dilakukan di satu toko akan dapat diselesaikan di toko lainnya pada grup yang sama.',
    'Once this option is enabled, the shops in this group will share customers. If a customer registers in any one of these shops, the account will automatically be available in the others shops of this group.' => 'Setelah opsi ini aktif, toko dalam grup ini akan berbagi data pelanggan. Jika pelanggan mendaftar di salah satu toko, akun tersebut akan ada ditoko lainnya dalam grup ini.',
    'Only UTF-8 and ISO 8859-1 encodings are allowed' => 'Hanya enkoding UTF-8 dan iso-8859-1 yang diperbolehkan',
    'Password should be at least %num% characters long.' => 'Panjang password minimum %num% karakter.',
    'Please ask your hosting provider for "phpMyAdmin" access to your database.' => 'Minta penyedia hosting Anda untuk memberikan akseske  "phpMyAdmin" agar Anda dapat mengakses database Anda',
    'Port number to use.' => 'Port yang digunakan.',
    'Quick description of the key: who it is for, what permissions it has, etc.' => 'Keterangan singkat mengenai key: untuk siapa, apa hak aksesnya, dll.',
    'Read more about the CSV format at:' => 'Baca lebih lanjut mengenai format CSV di:',
    'Set "Enable Shop" to "No" in the "Maintenance" page under the "Preferences" menu.' => 'Set "Enable Shop" ke "No di halaman "Maintenance" dibawah menu "Preferences".',
    'Set the amount of hours during which the front office cookies are valid. After that amount of time, the customer will have to log in again.' => 'Tentukan berapa  jam cookies di front office valid. Setelah itu, pelanggan harus login kembali.',
    'Severity levels' => 'Keparahan tingkat',
    'Should be enabled if you want to avoid to store the smarty cache on NFS.' => 'Harus diaktifkan jika Anda tidak ingin menyimpan cache smarty dalam NFS.',
    'Since the selected shop has no main URL, you have to set this URL as the Main URL.' => 'Karena toko yang dipilih tidak memiliki URL utama, Anda harus set URL berikut sebagai URL utama.',
    'Some features can be disabled in order to improve performance.' => 'Beberapa fitur dapat dinonaktifkan untuk meningkatkan performance.',
    'The selected shop already has a Main URL. Therefore, if you set this one as the Main URL, the older Main URL will be set as a regular URL.' => 'Toko tersebut sudah menggunakan URL utama. Jika toko ini diset menggunakan URL utama, maka URL lama akan diset sebagai URL biasa.',
    'This is the physical folder for your store on the web server. Leave this field empty if your store is installed on the root path. For instance, if your store is available at www.example.com/my-store/, you must input my-store/ in this field.' => 'Direktori fisik toko Anda di web server. Kosongkan field ini jika toko Anda diinstall di root. Misalnya, jika toko Anda berada di www.example.com/my-store/, Anda harus mengisi my-store/.',
    'This page will be displayed just after login.' => 'Halaman ini akan ditampilkan pada saat login.',
    'This will add directives to your .htaccess file, which should improve caching and compression.' => 'Opsi ini akan menambahkan beberapa aturan pada file. .htaccess, yang akan memperbaiki kinerja kompresi dan cache.',
    'URL rewriting must be activated on your server to use this feature.' => 'URL rewriting harus aktif agar fitur ini dapat digunakan.',
    'Unless you enabled the "Drop existing tables" option, you must delete all tables from your current database.' => 'Kecuali Anda mengaktifkan "Hapus tabel yang ada", Anda harus menghapus semua tabel dari database Anda secara manual.',
    'Use this option to associate data (products, modules, etc.) the same way for each selected shop.' => 'Gunakan opsi ini untuk mengasosiasikan data (produk, modul, dll) di masing-masing toko.',
    'Warning' => 'Peringatan',
    'Warning: Enabling the "share customers" and "share orders" options is not recommended. Once activated and orders are created, you will not be able to disable these options. If you need these options, we recommend using several categories rather than several shops.' => 'Perhatian: Mengaktifkan "bagikan pelanggan" dan "bagikan pembelian" tidak direkomendasikan. Karena setelah diaktifkan dan pembelian dibuat, fitur ini tidak dapat dinonaktifkan. Jika Anda memerlukan opsi ini, disarankan untuk menggunakan beberapa kategori daripada beberapa toko.',
    'Warning: URL rewriting (e.g. mod_rewrite for Apache) seems to be disabled. If your Virtual URL doesn\'t work, please check with your hosting provider on how to activate URL rewriting.' => 'Perhatian: URL rewriting (mis. mod_rewrite oada Apache) sepertinya nonaktif. Jika Virtual URL tidak berfungsi, harap koordinasi dengan tempat hosting Anda untuk mengaktifkan URL rewriting.',
    'Warning: You will not be able to disable this option once you\'ve started to accept orders.' => 'Perhatian: Anda tidak akan dapat menonaktifkan opsi setelah ada pembelian.',
    'Warning: you will not be able to disable this option once you have registered customers.' => 'Perhatian: Anda tidak akan dapat menonaktifkan opsi setelah ada pelanggan yang mendaftar.',
    'Where customers send messages from the order page.' => 'Ketika pelanggan mengirim pesan dari halaman order',
    'You can also upload your file via FTP to the following directory: %s .' => 'Anda juga dapat mengunggah file via FTP ke folder berikut ini: %s .',
    'You can read information on import at:' => 'Anda dapat membaca tentang impor di:',
    'You can use this option if you want to create a store with a URL that doesn\'t exist on your server (e.g. if you want your store to be available with the URL www.example.com/my-store/shoes/, you have to set shoes/ in this field, assuming that my-store/ is your Physical URL).' => 'Anda dapat menggunakan opsi ini jika akan membuat toko dengan URL yang belum ada (misalnya buat toko dengan URL www.example.com/my-store/shoes/, maka Anda harus mengeset shoes/ pada field, dengan catatan my-store/ adalah URL fisik).',
    'You cannot set this parameter to No when combinations are already used by some of your products' => 'Anda tidak dapat merubah parameter ini ke Tidak jika masih ada kombinasi yang digunakan oleh produk Anda',
    'https://en.wikipedia.org/wiki/Comma-separated_values' => 'https://en.wikipedia.org/wiki/Comma-separated_values',
    'or' => 'atau',
  ),
